window.bookSummaryJSON = "<p>Meet The Prices.... Sexy. Forbidden. Arrogant.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p><i>The Price Dynasty</i> is a contemporary romance box set filled with billionaire alphas, witty banter, and shocking plot twists.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p><b>Book One: </b><b><i>Deceit</i></b>&nbsp;</p> <p>I needed to get away.&nbsp;&nbsp;&nbsp;</p> <p>My ex was getting married.&nbsp;</p> <p>So, I left.&nbsp;</p> <p>The English countryside was a picture-perfect escape.&nbsp;</p> <p>The dashing stranger an even better one.&nbsp;</p> <p>And what started as a chance encounter quickly became more.&nbsp;&nbsp;&nbsp;</p> <p>He promised to show me how to live, how to feel alive and forget a past best forgotten.&nbsp;</p> <p>He made me believe things could be different.&nbsp;</p> <p>That was until I found out who he was....&nbsp;&nbsp;&nbsp;</p> <p>He was Oliver Blackthorn.&nbsp;&nbsp;&nbsp;</p> <p>The 16th Earl of Lockhart.&nbsp;Thirty-third in line to the throne.&nbsp;&nbsp;&nbsp;</p> <p>And a liar.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p><b>Book Two: </b><b><i>Entice&nbsp;&nbsp;&nbsp;</i></b></p> <p>Eight years ago, I gave Grayson Price a piece of my heart.&nbsp;&nbsp;&nbsp;</p> <p>To him, I was the strange girl whose mom had just abandoned her.&nbsp;&nbsp;&nbsp;</p> <p>To me, he was a savior, an anchor, someone who stood beside me on that beach.&nbsp;&nbsp;&nbsp;</p> <p>The next time I saw him, I was 20, and he was 36.&nbsp;&nbsp;&nbsp;</p> <p>He didn't remember me. And when he flirted...I didn't tell him.&nbsp;&nbsp;&nbsp;</p> <p>By the time he found out, it was too late.&nbsp;&nbsp;&nbsp;</p> <p>We tried to deny our desire, but our attraction was too enticing.&nbsp;&nbsp;&nbsp;</p> <p>Eight years ago, I gave Grayson Price a piece of my heart.&nbsp;&nbsp;&nbsp;</p> <p>Too bad he’s my dad’s best friend.&nbsp;&nbsp;&nbsp;&nbsp;</p> <p><b>Book Three: </b><b><i>Conceal</i></b>&nbsp;</p> <p>I ran.&nbsp;&nbsp;&nbsp;</p> <p>Escaped the man who wanted to hurt me.&nbsp;&nbsp;&nbsp;</p> <p>I got in my car and drove.&nbsp;&nbsp;&nbsp;</p> <p>No destination. No direction. No help.&nbsp;&nbsp;&nbsp;</p> <p>I hid in the one place I would never be found.&nbsp;&nbsp;&nbsp;</p> <p>Now in New York with no job, I didn't know what to do.&nbsp;&nbsp;&nbsp;</p> <p>Then I met him.&nbsp;&nbsp;&nbsp;</p> <p>Jaxson Price.&nbsp;&nbsp;&nbsp;</p> <p>The enigmatic devil who wasn't only above the law, but played it like a puppet.&nbsp;&nbsp;&nbsp;</p> <p>He might be the answer to all my problems.&nbsp;&nbsp;&nbsp;</p> <p>Too bad he's asking for something in return for his help....&nbsp;&nbsp;&nbsp;</p> <p>My heart.&nbsp;</p>"; 
